import React from "react";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2em",
          textAlign: "center",
          marginTop: "vh",
        }}
      >
        Quiz Analysis
      </p>
    </div>
  );
}

export default Analytics;
